func TestCollect(t *testing.T) {
	testcases := []struct {
		name    string
		in      *Input
		wantErr bool
		want    []string
	}{
		{
			name: "good case",
			in: &Input{
				Scheme:         "http",
				Host:           "127.0.0.1",
				Port:           8091,
				AdditionalPort: 9102,
				User:           "Administrator",
				Password:       "123456",
				Election:       true,
				tagger:         &mockTagger{},
			},
			wantErr: false,
			want:    wantStrs,
		},
		{
			name: "local and no election",
			in: &Input{
				Scheme:         "http",
				Host:           "127.0.0.1",
				Port:           8091,
				AdditionalPort: 9102,
				User:           "Administrator",
				Password:       "123456",
				Election:       false,
				tagger:         &mockTagger{},
			},
			wantErr: false,
			want:    wantStrsNoElection,
		},
		{
			name: "no password",
			in: &Input{
				Scheme:         "http",
				Host:           "127.0.0.1",
				Port:           8091,
				AdditionalPort: 9102,
				User:           "Administrator",
				Password:       "",
				Election:       true,
				tagger:         &mockTagger{},
			},
			wantErr: true,
		},
		{
			name: "error password",
			in: &Input{
				Scheme:         "http",
				Host:           "127.0.0.1",
				Port:           8091,
				AdditionalPort: 9102,
				User:           "Administrator",
				Password:       "error123456",
				Election:       true,
				tagger:         &mockTagger{},
			},
			wantErr: true,
		},
		{
			name: "error username",
			in: &Input{
				Scheme:         "http",
				Host:           "127.0.0.1",
				Port:           8091,
				AdditionalPort: 9102,
				User:           "errorAdministrator",
				Password:       "123456",
				Election:       true,
				tagger:         &mockTagger{},
			},
			wantErr: true,
		},
	}

	for _, tc := range testcases {
		t.Run(tc.name, func(t *testing.T) {
			ts := httptest.NewServer(http.HandlerFunc(func(w http.ResponseWriter, r *http.Request) {
				if r.Method != "GET" {
					w.WriteHeader(http.StatusMethodNotAllowed)
					t.Errorf("Expected 'GET' request, got '%s'", r.Method)
				}

				username, password, ok := r.BasicAuth()
				if username != "Administrator" || password != "123456" || !ok {
					w.WriteHeader(http.StatusUnauthorized)
					w.Write([]byte("check username password error."))
				}

				w.WriteHeader(http.StatusOK)
				switch r.URL.EscapedPath() {
				case "/pools/default":
					w.Write([]byte(pools_default))
				case "/pools/default/buckets":
					w.Write([]byte(pools_default_buckets))
				case "/pools/default/tasks":
					w.Write([]byte(pools_default_tasks))
				case "/pools/default/buckets/@query/stats":
					w.Write([]byte(pools_default_buckets_query_stats))
				case "/pools/default/buckets/@index/stats":
					w.Write([]byte(pools_default_buckets_index_stats))
				case "/pools/default/buckets/@fts/stats":
					w.Write([]byte(pools_default_buckets_fts_stats))
				case "/pools/default/buckets/@cbas/stats":
					w.Write([]byte(pools_default_buckets_cbas_stats))
				case "/pools/default/buckets/@eventing/stats":
					w.Write([]byte(pools_default_buckets_eventing_stats))
				case "/pools/default/buckets/beer-sample/nodes":
					w.Write([]byte(pools_default_buckets_beer_sample_nodes))
				case "/pools/default/buckets/beer-sample/stats":
					w.Write([]byte(pools_default_buckets_beer_sample_stats))
				case "/api/v1/stats":
					w.Write([]byte(api_v1_stats_9102))
				case "/pools/default/buckets/beer-sample/nodes/192.168.56.14%3A8091/stats":
					w.Write([]byte(pools_default_buckets_beer_sample_stats_ip_stats))
				default:
					t.Errorf("r.URL.EscapedPath error', got: '%s'", r.URL.EscapedPath())
				}
			}))
			defer ts.Close()

			ipt := tc.in
			err := ipt.setup()
			if err != nil {
				assert.NoError(t, err)
				return
			}

			portInt, _ := getPort(ts.URL)
			ipt.client.Opt.Port = portInt
			ipt.client.Opt.AdditionalPort = portInt

			err = ipt.client.GetPts()
			if err != nil {
				if tc.wantErr {
					// It's ok, I want.
					return
				}
				assert.NoError(t, err)
			}

			// check
			arr := make([]string, 0)
			for _, pt := range ipt.client.Pts {
				s := pt.LineProto()
				arr = append(arr, s[:strings.LastIndex(s, " ")])
			}
			sort.Strings(arr)

			if len(tc.want) != len(arr) {
				t.Errorf("the length of want != got.")
			}
			for i := range arr {
				// fmt.Println(arr[i])
				assert.Equal(t, arr[i], tc.want[i], true)
			}
		})
	}
}

